column8:
弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。PIAA製でありながら国内未発売の<br>
スーパーマルチリフレクタータイプのレンズを採用した<br>
イオンイエローレンズタイプ530シリーズの<br>
LED球採用フォグランプです。<br>
メーカー公称照射幅70°仕様。<br>
輸出専用モデルのため取説は英文のみです。<br>
PIAAからリリースされている<br>
新シリーズLEDタイプの小型軽量フォグランプです。<br>
レンズ外径84φで、ボディー外径は90φです。<br>
12V専用品<br>
本体2個とリレー、スイッチ等を含めたキット。<br>
納期が掛かる場合があります。<br>
お急ぎの場合は先に納期を確認の上ご注文いただきますようお願いします。
<br>送料区分 ： 120<!-- ここから リア受 -->
